import React from "react";

function Form(props) {
  return (
    <form className="form">
      <input type="text" placeholder="Username" />
      <input type="password" placeholder="Password" />
      (props.Registered === false && <Register/>)
      (props.Registered === true && <Login/>)

    </form>
  );
}

export default Form;
